export function getUsers(){
  let responseReturn;

  const options = {
    method: "GET",
    headers: {
      "Authorization": "Basic YWRtaW46YWRtaW4=",
      "Content-Type": "application/json",
    },
  }

  fetch("http://localhost:8080/usuarios/todos-os-usuarios", options)
    .then(response => {
      responseReturn = response.json();
      console.log(responseReturn);
    });

  return responseReturn;
}
